Trading Simulator features:
- buying, selling and closing operations with a specific volume;
- generated stock chart;

It’s a game for those who loves knives and thrill! 
Be on knife edge, take risks and hit the targets! 
Pick up a knife and stick it into the target! 

Game features
- more than 120 blades with a cool design;
- physics-based realistic knives; 
- 3 different game scenes in one game;
- awesome graphics;
- unique game mechanics;
